column58:
Vorrei segnalarvi una mancata segnaletica stradale che indichi il centro dialisi, anche per i mezzi di soccorso;
per quanto riguarda il centro dialisi:
spogliatoi troppo piccoli;
televisori con scarso segnale.
Noi pazienti ci chiediamo anche come è possibile che avete spostato un ausiliare che svolgeva anche più mansioni del dovuto facendo autista e ausiliare ,migliorando i vostri servizi, un ausiliare che sapeva fare il proprio mestiere e ci faceva stare bene, mentre, c'è gente a volte anche maleducata, che scalda la sedia e ne risente anche l'igiene della struttura;
molti pazienti non usano più il vostro servizio di trasporto, utilizzando associazioni  che non rispettano gli orari e creano disagi per tutto il sistema; questo è un problema che riguarda specialmente noi pazienti, perché noi pazienti vorremmo essere rispettati e trattati tutti uguali. 
Abbiamo già sollecitato la nostra capo sala , però senza risultati, anzi la situazione sta degenerando e questo sta portando molti pazienti a cambiare centro dialisi.
Queste magari per voi possono sembrare stupidaggini ma per noi fanno la differenza.
Spero in un vostro intervento, grazie.
